/*
 * Accepts a line and returns an nxn matrix whose entries are
 * the length of the line across each "pixel" in the matrix
 *
 * Parameters:
 *   d     - distance of the line from the origin (center of the matrix)
 *   theta - angle the line makes (with the x axis??) in radians
 *   n     - the size of the matrix 
 */
function line_pixel_length(d, theta, n) {
  // for angle in [pi/4,3*pi/4],
  // flip along diagonal (transpose) and call recursively
  if(theta > Math.PI /4 && theta < 3/4*Math.PI) {
    return numeric.transpose(line_pixel_length(d, Math.PI/2-theta, n));
  }

  // for angle in [3*pi/4,pi],
  // redefine line to go in opposite direction
  if(theta > Math.PI/2) {
    d =-d;
    theta = theta-Math.PI;
  }

  // for angle in [-Math.PI/4,0],
  //  flip along x-axis (up/down) and call recursively
  if(theta < 0) {
    // flip up down with reverse
    return flipud(line_pixel_length(-d,-theta,n));
  }

  if(theta > Math.PI/2 || theta < 0) {
    console.log("invalid angle")
    return;
  }

  var L = zeros(n,n);

  var ct = Math.cos(theta);
  var st = Math.sin(theta);

  var x0 = n/2 - d*st;
  var y0 = n/2 + d*ct;

  var y = y0 - x0*st/ct;
  var jy = Math.ceil(y);
  var dy = (y+n) % 1;

  for(var jx=1; jx <= n; jx++){
    var dynext = dy + st/ct;
    if(dynext < 1){
      if (jy >= 1 && jy <= n){
          L[n-jy][jx-1] = 1/ct;
      }
      dy = dynext;
    }else{
      if (jy>=1 && jy<=n) L[n-jy][jx-1] = (1 - dy)/st ;
      if (jy+1>=1 && jy+1<=n) L[n-(jy+1)][jx-1] = (dynext - 1)/st; 
      dy = dynext - 1;
      jy = jy + 1;
    }
  }
  return L;
}

//returns a number from the normal mean zero distribution with
//standard deviation sigma
//uses the polar form of the box-mueller transformation 
function randomNormal(sigma){
    var u = 2*Math.random()-1;
    var v = 2*Math.random()-1;
    var r = u*u + v*v;
    /*if outside interval [0,1] start over*/
    if(r == 0 || r > 1) return randomNormal(sigma);

    var c = Math.sqrt(-2*Math.log(r)/r);
  //  console.log("rand output: " + sigma*(u*c));
    return sigma*(u*c);
}

/*
 *  Generates the coefficient matrix of image x of width, width 
 *  by taking  measurements of lines with displacement Nd and angle with the
 *  horizontal Ntheta 
 */
function generateMeasurements(x, width, Nd, Ntheta, sigma) {
  var N = Nd*Ntheta;
  var y=zeros(N,1)           // will store the N measurements
  var lines_d=zeros(N,1);     // will store the position of each line
  var lines_theta=zeros(N,1); // will store the angle of each line
  var i=1;
  //

  for(var itheta=1; itheta <= Ntheta; itheta++){
    for(var id=1; id <= Nd; id++){
      // equally spaced parallel lines, distance from first to
      // last is about 1.4*n_pixels_wide (to ensure coverage of whole
      // image when theta=pi/4)
      lines_d[i-1]= 0.7*width*(id-Nd/2-0.5)/(Nd/2);
      
      // equally spaced angles from 0 to pi
      lines_theta[i-1]=Math.PI*itheta/Ntheta;

      // L is a matrix of the same size as the image
      // with entries giving the length of the line over each pixel
      var L = line_pixel_length(lines_d[i-1],lines_theta[i-1], width);

      var l = col_flatten(L); // make matrix L into a vector, as for X

    //  console.log("norm l: " + numeric.norm2(l));
     // var maxX = Math.max.apply(null,x);
     // console.log("max x: " + maxX);

      y[i-1]= numeric.dot(l,x) + randomNormal(sigma); //+ randn()*sigma
               // l'*x gives "line integral" of line over image,
               // that is, the intensity of each pixel is multiplied by the
               // length of line over that pixel, and then add for all pixels;
               // a random, Gaussian noise, with std sigma is added to the
               // measurement
      i=i+1; // for next measurement line
    }
  }
  doneMeasurements = true; 
  return {y: y, lines_d: lines_d, lines_theta: lines_theta}
}

// Patch numeric to add a sparse matrix transpose routine.
numeric.ccsTranspose = function( A )
{
    var rows_cols_vals = numeric.ccsGather( A );
    // Swap the rows and cols.
    return numeric.ccsScatter( [ rows_cols_vals[1], rows_cols_vals[0], rows_cols_vals[2] ] );
}

  function generateCoeffMatrix(x, n_pixels_wide,  Nd, Ntheta, sigma) {
    var N = Nd*Ntheta;
    var meas = generateMeasurements(x,n_pixels_wide,Nd,Ntheta,sigma);
    var A = zeros(N,Math.pow(n_pixels_wide,2));
    for(var i = 1; i <= N; i++){
      var d = meas.lines_d[i-1];
      var theta = meas.lines_theta[i-1];
      var lengths = line_pixel_length(d, theta, n_pixels_wide);
      lengths = col_flatten(lengths);
      A[i-1] = lengths;
    }
    var b = numeric.dot(numeric.transpose(A),meas.y);
    A = numeric.ccsSparse(A);
    var AtA = numeric.ccsDot(numeric.ccsTranspose(A), A);
    //console.log(numeric.ccsDim(AtA));
    //var AtA = numeric.dot(numeric.transpose(A),A);

    return {AtA: AtA, y: meas.y, b: b, lines_theta: meas.lines_theta, lines_d: meas.lines_d};
  }

  function genSmoothingMatrix(n_pixels_wide) {
    var horzd = numeric.add(horzcat(eye(n_pixels_wide-1), zeros(n_pixels_wide-1,1)),
                    horzcat(zeros(n_pixels_wide-1,1), numeric.mul(eye(n_pixels_wide-1),-1.0)));
    horzd = blkdiag(horzd,n_pixels_wide);
    var g = n_pixels_wide*(n_pixels_wide-1);
    var vertd = numeric.add(horzcat(eye(g), zeros(g,n_pixels_wide)),
                    horzcat(zeros(g,n_pixels_wide), numeric.mul(eye(g),-1.0)));
    var D = numeric.mul(vertcat(vertd,horzd),-1.0);
    return D;
  }

  function matrixFromImage(myImage){
    // Get a reference to the image you want the pixels of and its dimensions
    var w = myImage.width, h = myImage.height;
    // Create a Canvas element
    var canvas = document.createElement('canvas');
    canvas.width = w;
    canvas.height = h;
    // Draw image onto the canvas
    var ctx = canvas.getContext('2d');
    ctx.drawImage(myImage, 0, 0);
    // Finally, get the image data
    // ('data' is an array of RGBA pixel values for each pixel)
    var idata = ctx.getImageData(0, 0, w, h);
    return matrix(h,w, function(i,j) {
      var idx = (i*w + j)*4;
      return (idata.data[idx]*0.2989 + 
             idata.data[idx+1]*0.5870 + 
             idata.data[idx+2]*0.1140); 
    });
  }

  function imageFromMatrix(X){
    var canvas = document.createElement("canvas");
    var ctx = canvas.getContext("2d");
    var w = X[0].length; var h = X.length;
    canvas.width = w;
    canvas.height = h;
    var imgData = ctx.getImageData(0,0,w,h);
    for(var y = 0; y < h; y++) {
      for(var x = 0; x < w; x++) {
        var pos = (y*w+ x) * 4; 
        imgData.data[pos  ] = X[y][x]; // R Value
        imgData.data[pos+1] = X[y][x]; // G value
        imgData.data[pos+2] = X[y][x]; // B value
        imgData.data[pos+3] = 255;     // alpha channel
      }
    }
    ctx.putImageData(imgData,0,0);
    var image = new Image();
    image.src = canvas.toDataURL();
    return image;
  }

 
   
