// return a random permutation of array (0:maxValue)
function randperm(maxValue){
    // first generate number sequence
    var permArray = new Array(maxValue);
    for(var i = 0; i < maxValue; i++){
        permArray[i] = i;
    }
    // draw out of the number sequence
    for (var i = (maxValue - 1); i >= 0; --i){
        var randPos = Math.floor(i * Math.random());
        var tmpStore = permArray[i];
        permArray[i] = permArray[randPos];
        permArray[randPos] = tmpStore;
    }
    return permArray;
}

  //returns a fixed permutation of length n from the array (0:m-1)
  function getPermutation(n, m){
    var permutation = randperm(m);
    return permutation.slice(1,n);
  }


//Plot a heat map line  
function plot_line(d, theta, intensity, w, n){
  // intensity between 0 and 1

  var d1 = [];
  var x = 0; 

  while(true){
    if(x >=n) break; 
    var y = (x - n/2) * Math.tan(theta) + (d/Math.cos(theta) + n/2);
    d1.push([x, y]);
    x = x+0.1; 
  }


  color_rgb = pt_to_heatmap(intensity);
  return {color: color_rgb, data : d1};
}


//expects x in (0,1), returns rgb values 0-1
function  pt_to_heatmap(x){

//DON"T CHANGE P, it'll render the heatmap legend invalid
var p = [0.08, 0.38, 0.62, 0.88];

if (x < p[0]) { 
  r = 0;
  g = 0;
  b = (0.5-0)/(p[0]-0) * x + 0.5;
}
else if (x < p[1]){
  r = 0;
  g = (1-0)/(p[1]-p[0]) * (x-p[0]);
  b = 1;
}
else if (x < p[2]) 
{
  r = (1-0)/(p[2]-p[1]) * (x-p[1]);
  g = 1;
  b = (0-1)/(p[2]-p[1]) * (x-p[1]) + 1;
}
else if (x < p[3]){
  r = 1;
  g = (0-1)/(p[3]-p[2]) * (x-p[2]) + 1;
  b = 0;
}
else {
  r = (0.5-1)/(1-p[3]) * (x-p[3]) + 1;
  g = 0;
  b = 0;
}

//for javascript 
r = Math.floor(r*255);
g = Math.floor(g*255);
b = Math.floor(b*255);

return 'rgb(' + r + ',' + g + ',' + b + ')'; 
}



